

CREATE TABLE `cat_tbl` (
  `emp_dept_id` int(10) NOT NULL AUTO_INCREMENT,
  `emp_dept_name` varchar(100) NOT NULL,
  PRIMARY KEY (`emp_dept_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;






CREATE TABLE `dept_tbl` (
  `dept_id` int(15) NOT NULL AUTO_INCREMENT,
  `block_name` varchar(200) NOT NULL,
  `dept_name` varchar(200) NOT NULL,
  `room_name` varchar(200) NOT NULL,
  `room_no` varchar(200) NOT NULL,
  PRIMARY KEY (`dept_id`)
) ENGINE=InnoDB AUTO_INCREMENT=197 DEFAULT CHARSET=latin1;






CREATE TABLE `desig_tbl` (
  `desig_id` int(10) NOT NULL AUTO_INCREMENT,
  `desig_name` varchar(100) NOT NULL,
  PRIMARY KEY (`desig_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;






CREATE TABLE `issue_tbl` (
  `sno` int(15) NOT NULL AUTO_INCREMENT,
  `dept_id` int(15) NOT NULL,
  `item_id` int(15) NOT NULL,
  `unit_id` int(15) NOT NULL,
  `unitsissued` int(15) NOT NULL,
  `noofitems` int(15) NOT NULL,
  `indentno` varchar(200) NOT NULL,
  `voucherno` varchar(200) NOT NULL,
  `issueddate` date NOT NULL,
  `transfer_no` varchar(20) NOT NULL,
  PRIMARY KEY (`sno`),
  KEY `dept_id` (`dept_id`),
  KEY `item_id` (`item_id`),
  KEY `unit_id` (`unit_id`),
  CONSTRAINT `issue_tbl_ibfk_1` FOREIGN KEY (`dept_id`) REFERENCES `dept_tbl` (`dept_id`),
  CONSTRAINT `issue_tbl_ibfk_2` FOREIGN KEY (`item_id`) REFERENCES `item_tbl` (`item_id`),
  CONSTRAINT `issue_tbl_ibfk_3` FOREIGN KEY (`unit_id`) REFERENCES `unit_tbl` (`unit_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7555 DEFAULT CHARSET=latin1;






CREATE TABLE `item_tbl` (
  `item_id` int(15) NOT NULL AUTO_INCREMENT,
  `item_name` varchar(200) NOT NULL,
  PRIMARY KEY (`item_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1767 DEFAULT CHARSET=latin1;






CREATE TABLE `master_backupdatabase` (
  `auto_number` int(255) NOT NULL AUTO_INCREMENT,
  `backupfilename` varchar(255) COLLATE latin1_general_ci NOT NULL,
  `backupfiledate` datetime NOT NULL,
  `username` varchar(255) COLLATE latin1_general_ci NOT NULL,
  `ipaddress` varchar(255) COLLATE latin1_general_ci NOT NULL,
  PRIMARY KEY (`auto_number`)
) ENGINE=MyISAM AUTO_INCREMENT=181 DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci;






CREATE TABLE `purchase_tbl` (
  `sno` int(15) NOT NULL AUTO_INCREMENT,
  `supplier_id` int(15) NOT NULL,
  `item_id` int(15) NOT NULL,
  `unit_id` int(15) NOT NULL,
  `unitsreceived` int(15) NOT NULL,
  `noofitems` int(15) NOT NULL,
  `billno` varchar(200) NOT NULL,
  `billdate` varchar(25) NOT NULL,
  `rcvcno` varchar(200) NOT NULL,
  `rcdate` varchar(25) NOT NULL,
  `user` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`sno`),
  KEY `supplier_id` (`supplier_id`),
  KEY `item_id` (`item_id`),
  KEY `unit_id` (`unit_id`),
  CONSTRAINT `purchase_tbl_ibfk_1` FOREIGN KEY (`supplier_id`) REFERENCES `supplier_tbl` (`supplier_id`),
  CONSTRAINT `purchase_tbl_ibfk_2` FOREIGN KEY (`item_id`) REFERENCES `item_tbl` (`item_id`),
  CONSTRAINT `purchase_tbl_ibfk_3` FOREIGN KEY (`unit_id`) REFERENCES `unit_tbl` (`unit_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2973 DEFAULT CHARSET=latin1;






CREATE TABLE `roomsdata_tbl` (
  `sno` int(11) NOT NULL AUTO_INCREMENT,
  `room_id` int(11) NOT NULL,
  `item_id` int(11) NOT NULL,
  `quantity` int(11) DEFAULT NULL,
  PRIMARY KEY (`sno`),
  KEY `room_id` (`room_id`,`item_id`),
  CONSTRAINT `roomsdata_tbl_ibfk_1` FOREIGN KEY (`room_id`) REFERENCES `dept_tbl` (`dept_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






CREATE TABLE `staff_tbl` (
  `emp_id` int(10) NOT NULL AUTO_INCREMENT,
  `emp_name` varchar(100) NOT NULL,
  `emp_desig_id` int(10) NOT NULL,
  `emp_dept_id` int(10) NOT NULL,
  `emp_mobile` bigint(15) NOT NULL,
  `emp_email` varchar(200) DEFAULT NULL,
  `remarks` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`emp_id`),
  KEY `emp_desig_id` (`emp_desig_id`),
  KEY `emp_dept_id` (`emp_dept_id`),
  CONSTRAINT `emp_tbl_ibfk_1` FOREIGN KEY (`emp_desig_id`) REFERENCES `desig_tbl` (`desig_id`),
  CONSTRAINT `emp_tbl_ibfk_2` FOREIGN KEY (`emp_dept_id`) REFERENCES `cat_tbl` (`emp_dept_id`)
) ENGINE=InnoDB AUTO_INCREMENT=151 DEFAULT CHARSET=latin1;

